import React from 'react';
import './App.css';
import {observer,inject} from 'mobx-react'

@inject('TodoStore')
@observer
class App extends React.Component {
  render(){
    const store = this.props.TodoStore;
  return (
    <div className="App">
      <h1>Todo List</h1>
      <h2>{store.getTodoCount}</h2>
    </div>
  );
}
}
export default App;
